import React from "react";
import "../css/projects.css"

const ShowPage = () =>{
    return(
    <div>
        <table>
            <tbody>
                {
                    fetch("Projects.json")
                    .then(res => res.json())
                    .then(data => {
                        data.results.map(project => {
                            return(
                                <tr>
                                    <td className="project-title">{project.Title}</td>
                                    <td className="project-anchor"><a href={project.Link}> Click Here</a></td>
                                    <td className="project-img"><img ref={`Media/${Product.Img}`} /></td>
                                </tr>
                            )
                        })
                    })
                }
            </tbody>
        </table>
    </div>
    )
}

export default ShowPage;
